public class Solution {
    public long NumberOfPowerfulInt(long start, long finish, int limit, string s) {
        long count = 0;
        long suffix = long.Parse(s);
        long baseNumber = 1;
        while (baseNumber < suffix) baseNumber *= 10;

        for (long prefix = 0; ; prefix++) {
            long num = prefix * baseNumber + suffix;
            if (num > finish) break;
            if (num >= start) {
                bool valid = true;
                foreach (char c in num.ToString()) {
                    if (c - '0' > limit) {
                        valid = false;
                        break;
                    }
                }
                if (valid) count++;
            }
        }
        return count;
    }
}
